float medianBruteForce(const std::vector<int> &a, const std::vector<int> &b) {
    int total = a.size() + b.size();
    int mid = ceil(total / 2.0);

    int aIdx = 0;
    int bIdx = 0;
    
    int firstMid = 0;
    int secondMid = 0;
    if (a.size() != 0 && b.size() != 0) {
        // Find foward mid
        for (int i = 1; i < mid; ++i) {
            if (a[aIdx] <= b[bIdx]) ++aIdx;
            else ++bIdx;
            //cout << a[aIdx] << " " << b[bIdx] << endl;
        }
        firstMid = std::min(a[aIdx], b[bIdx]);
        
        // Find backward mid
        aIdx = a.size() - 1;
        bIdx = b.size() - 1;
        for (int i = total - 1; i > mid; --i) {
            if (a[aIdx] > b[bIdx]) --aIdx;
            else --bIdx;
            //cout << a[aIdx] << " " << b[bIdx] << endl;
        }
        secondMid = std::max(a[aIdx], b[bIdx]);
    }
    else if (a.size() == 0) {
        // Find foward mid
        for (int i = 1; i < mid; ++i) {
            ++bIdx;
            //cout << b[bIdx] << endl;
        }
        firstMid = b[bIdx];
        
        // Find backward mid
        bIdx = b.size() - 1;
        for (int i = total; i > mid; --i) {
            --bIdx;
            //cout << mid << " " << b[bIdx] << endl;
        }
        secondMid = b[bIdx];
    }
    else if (b.size() == 0) {
        // Find foward mid
        for (int i = 1; i < mid; ++i) {
            ++aIdx;
        }
        firstMid = a[aIdx];
        
        // Find backward mid
        aIdx = a.size() - 1;
        for (int i = total; i > mid; --i) {
            --aIdx;
        }
        secondMid = a[aIdx];
    }
    
    //cout << firstMid << " " << secondMid << endl;
    return (firstMid + secondMid) / 2.0;
}


class Subarray {
    std::vector<int> underlying;
    int start;
    int size;
    
    public:
    Subarray(const std::vector<int> &arr) {
        this->underlying = arr;
        this->start = 0;
        this->size = arr.size();
    }
    
    Subarray getSubArray(int i, int j) {
        if (i > j) throw "Invalid Range";
        if (j > this->size) throw "Out of Bounds range";
        Subarray s(this->underlying);
        s.start = this->start + i;
        s.size = j - i;
        return s;
    }
    
    int getSize() {
        return this->size;
    }
    
    int getFirst() {
        return underlying[start];
    }
    
    int getLast() {
        return underlying[start + size - 1];
    }
    
    double getMedian() {
        if (this->size % 2 == 0) {
            return (underlying[start + size / 2 - 1] + 
                    underlying[start + size / 2]) / 2.0;
        }
        return underlying[start + size / 2];
    }
};


/* Idea if we made one array from the two, 
A B C D E ... N
|---||--------|
  ^      ^
    ^
Therefore, moving the seperate medians closer to the global median
*/

double median(Subarray a1, Subarray a2) {
    if (a1.getSize() == 1) return (a1.getFirst() + a2.getFirst()) / 2.0;
    if (a1.getSize() == 2) {
        return (std::max(a1.getFirst(), a2.getFirst()) + 
                std::min(a2.getLast(), a1.getLast())) / 2.0;
    }
    
    double median1 = a1.getMedian();
    double median2 = a2.getMedian();
    
    if (median1 == median2) return median1;
    if (median1 > median2) {
        return median(a1.getSubArray(0, a1.getSize() / 2 + 1), 
                      a2.getSubArray((a2.getSize() - 1) / 2, a2.getSize()));
    }
    return median(a1.getSubArray((a1.getSize() - 1) / 2, a1.getSize()),
                  a2.getSubArray(0, a2.getSize() / 2 + 1));
}

double median(const std::vector<int> &arr1, const std::vector<int> &arr2) {
    if (arr1.size() == 0 || arr1.size() != arr2.size()) {
        throw "Invalid Argument";
    }
    return median(Subarray(arr1), Subarray(arr2));
}


